static const char __pyx_k_Encode_categorical_integer_featu[] = "Encode categorical integer features using a one-hot aka one-of-K scheme.\n\n    The input to this transformer should be a matrix of integers, denoting\n    the values taken on by categorical (discrete) features. The output will be\n    a sparse matrix were each column corresponds to one possible value of one\n    feature. It is assumed that input features take on values in the range\n    [0, n_values).\n\n    This encoding is needed for feeding categorical data to many scikit-learn\n    estimators, notably linear models and SVMs with the standard kernels.\n\n    Parameters\n    ----------\n\n    categorical_features: \"all\" or array of indices or mask\n        Specify what features are treated as categorical.\n\n        - 'all' (default): All features are treated as categorical.\n        - array of indices: Array of categorical feature indices.\n        - mask: Array of length n_features and with dtype=bool.\n\n        Non-categorical features are always stacked to the right of the matrix.\n\n    dtype : number type, default=np.float\n        Desired dtype of output.\n\n    sparse : boolean, default=True\n        Will return sparse matrix if set True else will return an array.\n\n    Attributes\n    ----------\n    `active_features_` : array\n        Indices for active features, meaning values that actually occur\n        in the training set. Only available when n_values is ``'auto'``.\n\n    `feature_indices_` : array of shape (n_features,)\n        Indices to feature ranges.\n        Feature ``i`` in the original data is mapped to features\n        from ``feature_indices_[i]`` to ``feature_indices_[i+1]``\n        (and then potentially masked by `active_features_` afterwards)\n\n    `n_values_` : array of shape (n_features,)\n        Maximum number of values per feature.\n\n    Examples\n    --------\n    Given a dataset with three features and two samples, we let the encoder\n    find the maximum value per feature and transform the data to a binary\n    one-hot ""encoding.\n\n    >>> from sklearn.preprocessing import OneHotEncoder\n    >>> enc = OneHotEncoder()\n    >>> enc.fit([[0, 0, 3], [1, 1, 0], [0, 2, 1], [1, 0, 2]])  # doctest: +ELLIPSIS\n    OneHotEncoder(categorical_features='all', dtype=<... 'float'>,\n           sparse=True, minimum_fraction=None)\n    >>> enc.n_values_\n    array([2, 3, 4])\n    >>> enc.feature_indices_\n    array([0, 2, 5, 9])\n    >>> enc.transform([[0, 1, 1]]).toarray()\n    array([[ 1.,  0.,  0.,  1.,  0.,  0.,  1.,  0.,  0.]])\n\n    See also\n    --------\n    sklearn.feature_extraction.DictVectorizer : performs a one-hot encoding of\n      dictionary items (also handles string-valued features).\n    sklearn.feature_extraction.FeatureHasher : performs an approximate one-hot\n      encoding of dictionary items or strings.\n    ";
